import '../styles/About.css';
import Footer from './Footer';

const About = () => {
  return (
    <div className="about-page">
      <div className="about-content">
        <h1>About HahaHollywood Movie Reviewer</h1>
        {/* ... (rest of the content from the previous example) ... */}
        <p>Stay connected with us on social media to receive updates, behind-the-scenes content, and more:</p>
        <div className="social-media-icons">
          <a href="https://www.instagram.com/hahahollywood/" target="_blank" rel="noopener noreferrer">
            <img src="path/to/instagram-icon.png" alt="Instagram" />
          </a>
